import React from 'react';
import ''
const FloorComponent = ({ floor }) => {
    if (!floor) {
        return <div>No floor data available.</div>;
    }

    return (
        <div className="floor">
            <h2>Floor {floor.number}</h2>
            <p>Details: {floor.details}</p>
        </div>
    );
};

export default FloorComponent;
